import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView, MDBFormInline,
  MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';

class FullPageIntroWithFixedNavbar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      collapse: false,
      isWideEnough: false,
      isOpen: false
    };
    this.onClick = this.onClick.bind(this);
  }

  toggleCollapse = () => {
    this.setState({ isOpen: !this.state.isOpen });
  }

  onClick() {
    this.setState({
      collapse: !this.state.collapse
    });
  }
  
  render() {
    return (
      <div>
        <header>
          
<MDBNavbar color="indigo" dark expand="md">
        <MDBNavbarBrand>
          <a href='/'><strong className="white-text">Numerical Method</strong></a>
        </MDBNavbarBrand>
        <MDBNavbarToggler onClick={this.toggleCollapse} />
        <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>
          <MDBNavbarNav left>
            <MDBNavItem>
              <MDBDropdown>
                <MDBDropdownToggle nav caret>
                  <span className="mr-2">Root</span>
                </MDBDropdownToggle>
                <MDBDropdownMenu>
                  <MDBDropdownItem href="/Bisection">Bisection</MDBDropdownItem>
                  <MDBDropdownItem href="/Secant">Secant Method</MDBDropdownItem>
                  <MDBDropdownItem href="/False">False Position</MDBDropdownItem>
                </MDBDropdownMenu>
              </MDBDropdown>
            </MDBNavItem>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBNavbar>

         

          <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(50).jpg">
            <MDBMask overlay="black-light" className="flex-center flex-column text-white text-center">
              <h1>Numerical Method</h1>
              <br />
              <p></p>
            </MDBMask>
          </MDBView>
        </header>
        <br /><br />
      </div>
    );
  }
}

export default FullPageIntroWithFixedNavbar;
